import React, { Component } from "react";
import Modal from "react-bootstrap-modal";
import MemeOnProduct1 from "../Images/MemeOnProduct1.jpg";
import MemeOnProduct2 from "../Images/MemeOnProduct2.webp";

class ProductMemePopup extends Component {
  render() {
    return (
      <Modal
        show={this.props.showPopup}
        onHide={this.props.closePopup}
        scrollable={true}
      >
        <Modal.Header closeButton>
          <Modal.Title id="ModalHeader">Product Puns</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <div className="modal-open">
            <img
              src={MemeOnProduct1}
              width="700"
              className="border m-2"
              alt="Evolution of product"
            />
            <img
              src={MemeOnProduct2}
              width="1200"
              className="border m-2"
              alt="Evolution of product"
            />
          </div>
        </Modal.Body>
      </Modal>
    );
  }
}

export default ProductMemePopup;
